from bs4 import BeautifulSoup
import json

def parse_handbook_html(html_code):
    # Use BeautifulSoup to parse the HTML content
    soup = BeautifulSoup(html_code, 'html.parser')

    # Function to extract relevant sections and categorize content
    def extract_handbook_data(soup):
        data = {
            "meta_info": {},
            "links": [],
            "course_list": [],
            "filters": {},
            "campuses": [],
            "faculties": [],
            "categories": [],
        }

        # Extract meta information from head
        meta_tags = soup.find_all('meta')
        for meta_tag in meta_tags:
            if meta_tag.get('name'):
                data['meta_info'][meta_tag['name']] = meta_tag.get('content')
            elif meta_tag.get('property'):
                data['meta_info'][meta_tag['property']] = meta_tag.get('content')

        # Extract sitemap links from the navigation section
        sitemap = soup.find(id='sitemap')
        if sitemap:
            link_elements = sitemap.find_all('a')
            for link in link_elements:
                data['links'].append({
                    "text": link.text.strip(),
                    "url": link.get('href')
                })

        # Extract course list
        search_results = soup.find(id='search-results')
        if search_results:
            course_items = search_results.find_all('li', class_='search-result-item')
            for course_item in course_items:
                course_name = course_item.find('h3').text if course_item.find('h3') else ''
                course_code = course_item.find('span', class_='search-result-item__code').text if course_item.find('span', class_='search-result-item__code') else ''
                course_url = course_item.find('a', class_='search-result-item__anchor')['href'] if course_item.find('a', class_='search-result-item__anchor') else ''
                course_type = course_item['data-test-type'] if course_item.has_attr('data-test-type') else ''
                data['course_list'].append({
                    "course_name": course_name,
                    "course_code": course_code,
                    "course_url": course_url,
                    "course_type": course_type
                })

        # Extract search filters
        search_filters = soup.find(id='search-filters')
        if search_filters:
            filter_groups = search_filters.find_all('div', class_='search-filter-group')
            for group in filter_groups:
                label = group.find('label').text.strip() if group.find('label') else ''
                options = [opt.text.strip() for opt in group.find_all('option')]
                if label:
                    data['filters'][label] = options

        # Extract campus options
        campus_elements = soup.find(id='campus-attendance-mode')
        if campus_elements:
            campus_options = campus_elements.find_all('input', type='checkbox')
            for option in campus_options:
                campus_name = option.get('value')
                if campus_name:
                    data['campuses'].append(campus_name)

        # Extract faculty information
        faculties_dropdown = soup.find(id='search-input-item-faculty')
        if faculties_dropdown:
            faculty_options = faculties_dropdown.find_all('option')
            for option in faculty_options:
                faculty_label = option.text.strip()
                faculty_value = option.get('value')
                if faculty_value:
                    data['faculties'].append({
                        "label": faculty_label,
                        "value": faculty_value
                    })

        # Extract categories of content
        result_types = soup.find('ul', class_='search-type-list')
        if result_types:
            type_items = result_types.find_all('li')
            for item in type_items:
                input_element = item.find('input', type='radio')
                label_element = item.find('label')
                if input_element and label_element:
                    category = label_element.text.strip()
                    value = input_element.get('value')
                    if value:
                        data['categories'].append({
                            "category": category,
                            "value": value
                        })

        return data

    # Extract and return categorized data
    return extract_handbook_data(soup)

